import React from 'react'
import { Movies } from 'components/Movies'
//import { MovieDetails } from 'components/MovieDetails'

export const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" exact>
          <Movies />
        </Route>

      </Switch>
    </BrowserRouter>
  )
}
